Synopsis
Ib, a pretty writer who believes in true love, is living with her boyfriend Loyd, who is an advertising creative. Realizing the happiness of their love life is running out of time, Jib distressingly decides to leave Loyd. Later, Jib is back to Loyd, but something is different. Now, Loyd is forced to choose between someone who looks alike and the right answer in his heart.
